		this.scene=0;
		this.stop();
		this.addEventListener('pressup',Click);
		
		function Click(e){
			log(e.target.name);
			var parent = e.target.parent;
			switch (e.target.name){
				case 'BT_role0':
				case 'BT_role1':
				case 'BT_role2':
				case 'BT_role3':
					playSound('click');
					parent.gotoAndStop(e.target.name);
					break;
				case 'BT_re':
					playSound('click');
					_this.gotoAndStop(1);
					break;
				case 'BT_start':
					playSound('click');
					if (bgm.paused) bgm.play();
					root.gotoAndStop(2);
				
					if (!root.item1_) return;
					if (!root.item1_.Mask) return;
					root.item1_.Mask(root.powers[0]);
					root.item2_.Mask(root.powers[1]);
					root.item3_.Mask(root.powers[2]);
					break;
				case 'BT_replay':
					playSound('click');
					dialog.onended=null;
					e.target.visible=!true;
					root.gotoAndStop(1);
					break;
				case 'BT_result':
					playSound('click');
					root.gotoAndStop(root.ending.shift());
					dialog.onended=Result;
					break;
				case 'BT_next_d':
				case 'BT_next0':
					dialog.pause();
					playSound('click');
					parent.nextFrame();
					break;
				case 'BT_next_s':
					playSound('click');
					root.nextScene();
					break;
				case 'BT_next_e':
					playSound('click');
					var end='e2';
					for (var i=0;i<3;i++){
						if (root.powers[i]<=30) {
							root.ending.push("a"+(i+1));
							end='e1';
						}
					}
					for (var i=0;i<3;i++){
						if (root.powers[i]>=60) root.ending.push("b"+(i+1));
					}
					root.gotoAndStop(end);
					break;
				case 'BT_close':
					playSound('click');
					parent.gotoAndStop(0);
					break;
				case 'BT_tip':
					playSound('click');
					parent.gotoAndStop(1);
					break;
			}
		}
		function Result(){
			log('root.ending.length:',root.ending.length)
			if (root.ending.length) root.gotoAndStop(root.ending.shift());
			else {
				dialog.onended=null;
				root.BT_replay.visible=true;
			}
		}
		if (isTouch) createjs.Touch.enable(stage);
		root.nextScene=()=>{
			root.gotoAndStop('s'+(++root.scene));
		}
